package org.example.model;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Id;import jakarta.persistence.Table;@Table@Entity(name = "chequeBook")public class ChequeBook {    @Column(name = "accountNumber")    private String accountNumber;    @Id    @Column(name = "chequeBookNumber",nullable = false,unique = true,length = 20)    private String chequeBookNumber;    @Column(name = "sanctionedDate")    private String sanctionedDate;    public String getAccountNumber() {        return accountNumber;    }    public void setAccountNumber(String accountNumber) {        this.accountNumber = accountNumber;    }    public String getChequeBookNumber() {        return chequeBookNumber;    }    public void setChequeBookNumber(String chequeBookNumber) {        this.chequeBookNumber = chequeBookNumber;    }    public String getSanctionedDate() {        return sanctionedDate;    }    public void setSanctionedDate(String sanctionedDate) {        this.sanctionedDate = sanctionedDate;    }}